import React, { Component } from 'react';
import { AppRegistry, Button, StyleSheet, Text, TextInput, TouchableOpaciaty, View } from 'react-native';

export default class LogIn extends Component {
    render() {
    return (
      <View style={styles.container}>
        <Text style={styles.welcome}>
          Login Page
        </Text>
        <TextInput
          style={styles.input}
          placeholder="Username or email"
        />
        <TextInput
          style={styles.input}
          placeholder="Password"
        />
        <View> 
          <TouchableOpaciaty>
            <Text>Login</Text>
          </TouchableOpaciaty>
        </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#F5FC80',
  },
  welcome: {
    fontSize: 20,
    padding: 10,
    textAlign: 'center',
  },
  instructions: {
    textAlign: 'center',
    color: '#333333',
    marginBottom: 5,
  },
  input : {
    width: "90%",
    backgroundColor: "#FFFFFF",
    padding: 15,
    marginBottom: 10,

  },
});

AppRegistry.registerComponent('LogIn', () => LogIn);
